(1, 'Covid-19 ကူးစက္ေရာဂါမွ ကာကြယ္ရန္ -', '- အတတ်နိုင်ဆုံး လူများစွာနဲ့ နီးကပ်စွာ မနေပါနှင့်၊\r\n- အပြင်ထွက်တိုင်း နှာခေါင်းစည်းနှင့် မျက်နှာကာ (Mask and Faceshield) များ ဝတ်ဆင်ပါ၊\r\n- တစ်ခုခု ထိတွေ့ ကိုင်တွယ်ပြီးတိုင်း လက်ကို ဆပ်ပြာဖြင့် စက္ကန့် ၂၀ ခန့်ကြာအောင် စင်ကြယ်စွာ ဆေးကြောပါ၊\r\n- ကျန်းမာရေးနှင့် ညီညွတ်စွာ၊ အာဟာရပြည့်ဝစွာ နေထိုင်စားသောက်ပါ၊\r\n- ကောင်းမွန်စွာ အိပ်စက် အနားယူပါ။\r\n\r\n(STT Myanmar)', '2020-12-01 11:04:04', '2020-12-01 11:04:04');
